import React from "react";

const Eat = props => {
  console.log(props.dataString);
  return (
    <div>
      <h1>Eat</h1>
      <div class="container">
        <div class="row">
          <div class="col-sm col-md-3">
            <img
              className="w-100"
              alt="food"
              src="https://source.unsplash.com/1600x900/?food"
            ></img>
          </div>
          <div class="col-sm col-md-9">One of three columns</div>
        </div>
      </div>
    </div>
  );
};

export default Eat;
